import React from 'react'

function AppliedJobs() {
    const appliedJobs =[1,2,3,4];
  return (
    <div>
        {
            appliedJobs.length !==0 ?(
                <table className="table table-bordered table-hover text-c">
                    <thead>
                        <th>Date</th>
                        <th>Job Role</th>
                        <th>Company</th>
                        <th>Status</th>
                    </thead>
                    <tbody>
                        {
                            appliedJobs.map((job, index)=><tr key={index}>
                                <td>20-08-2024</td>
                                <td>Frontend developer</td>
                                <td>Accenture</td>
                                <td><span className='badge bg-dark'>Selected</span></td>
                            </tr>)
                        }
                    </tbody>
                </table>
            ):<span>No jobs applied</span>
        }
    </div>
  )
}

export default AppliedJobs
